import React from 'react';
import Card from './Card'

const CardList = (data) => (
    <div className='supply__container'>
        {
            Object.values(data)[0].map((element) => {
                return(
                    <Card
                        id={element._id} 
                        name={element.name}
                        cost={element.cost}
                        img={element.img}
                        descript={element.descript}
                        activeItem={data.activeItem}
                    />
                )
            })
        }
    </div>
)

export default CardList;
